import React from "react";
import Wallet from "./Wallet";
import HelperDisplayBar from "./HelperDisplayBar";
function GameContainer({updateMoney,miningPower,dps,shopData}) {


return( 
    <div className="grid-div" id="center-div">

    <h1>Money: {this.state.totalMoney}</h1>
    <h1 id="dps">DPS: {this.state.dps}</h1>
    <Wallet
      updateMoney= { updateMoney}
      miningPower={miningPower}
      dps={dps}
    />

    <HelperDisplayBar
    shopData={shopData}
    />
  </div>
)
}
export default GameContainer
